webpackJsonp([0x812e5b4edb3d],{1141:function(A,e){A.exports={data:{markdownRemark:{html:'<ol>\n<li>\n<p>Steve Jobs did not say “Stay Hungry, Stay Foolish”, he quoted this line from a 452-page book named “Whole Earth Catalog”.</p>\n</li>\n<li>\n<p>Critics and reporters have been saying the book has changed the world (not only through its influence on Steve Jobs), as a symbol of the formation of counterculture. A lot of new ideas and products, like solar power, recycling, wind power, desktop publishing were firstly introduced to mainstream audience from this book in late 1960s. </p>\n</li>\n<li>\n<p>The quote was printed on the back cover of its last edition, above a photo of a country road in the morning. Steve Jobs said, </p>\n</li>\n</ol>\n<p>“It was a photograph of an early morning country road, the kind you might find yourself hitchhiking on if you were so adventurous. Beneath it were the words: “Stay Hungry. Stay Foolish.” It was their farewell message as they signed off. Stay Hungry. Stay Foolish. And I have always wished that for myself. “</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/we-1-1489988ce8885fcb7fc4ed85f3c65fef-8d96c.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="./we-1.jpg"\n        title=""\n        src="/static/we-1-1489988ce8885fcb7fc4ed85f3c65fef-8d96c.jpg"\n        srcset="/static/we-1-1489988ce8885fcb7fc4ed85f3c65fef-1069a.jpg 320w,\n/static/we-1-1489988ce8885fcb7fc4ed85f3c65fef-8d96c.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="4">\n<li>It was believed Stewart Brand, the man behind Whole Earth Catalog, persuaded NASA to make its Earth shot-from-space photos available to the public. Therefore it was the reason why the book is called Whole Earth Catalog, it was like a glimpse of humanity’s achievement, building tools for a better life. </li>\n</ol>\n<p>Read more at Spatial Agency</p>',excerpt:"Steve Jobs did not say “Stay Hungry, Stay Foolish”, he quoted this line from a 452-page book named “Whole Earth Catalog”. Critics and reporters have been saying the book has changed the world (not only through its influence on Steve Jobs), as a…",frontmatter:{path:"/wholeearthcatalog",title:"Whole Earth Catalog",date:"June 03, 2018",tags:["localization","app"],intro:null,image:{publicURL:"/static/we-0-d2ca9207356ac731e75182677bbc4b1e.jpg",size:22347,childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/we-0-d2ca9207356ac731e75182677bbc4b1e-ab229.jpg",srcSet:"/static/we-0-d2ca9207356ac731e75182677bbc4b1e-93d86.jpg 285w,\n/static/we-0-d2ca9207356ac731e75182677bbc4b1e-ab229.jpg 500w",srcWebp:"/static/we-0-d2ca9207356ac731e75182677bbc4b1e-a12af.webp",srcSetWebp:"/static/we-0-d2ca9207356ac731e75182677bbc4b1e-8e7b6.webp 285w,\n/static/we-0-d2ca9207356ac731e75182677bbc4b1e-a12af.webp 500w",sizes:"(max-width: 500px) 100vw, 500px"}}}},fields:{nextTitle:"How to do localization right - Citymapper in Hong Kong",nextSlug:"/citymapper",prevTitle:"Lessons I learned from my personal project",prevSlug:"/lessons-learned-from-personal-project",slug:"/wholeearthcatalog"}}},pathContext:{}}}});
